int cmp(const void *a, const void *b){
    return *(int*)a - *(int*)b;  
}
int hash_f(char *key, int *T){
    int sum = 0, n = strlen(key);
    for(int i = 0; i < n; ++i){
        sum += T[i % 51] * key[i];
        sum %= 287047;
    }
    return sum;
}

int perfect_hash(char *key){
    return (G[hash_f(key, S1)] + G[hash_f(key, S2)]) % 287047;
}
void order(int start, int m, int M){

    for(int i = m; i <= M; ++i){
        if(used[i]){
            hash[start++] = i;
            used[i] = 0;
        }
    }
    return;
}
void lower(char* str){
    int n = strlen(str);
    for(int i = 0; i < n; ++i)
        if(isupper(str[i]))
            str[i] = tolower(str[i]);
    return;
}

int isOperator(char c){
    switch (c){
        case '!':
            return NOT;
        case '&':
            return AND;
        case '|':
            return OR;
        case '(':
            return OPEN;
        case ')':
            return CLOSE;
        }
    return -1;
}
int hashing(char* str){
    return perfect_hash(str);
}
void process_char_exp(char* input){
    int char_exp_length = (int) strlen(input);
    int operator_code;
    int token_length=0;
    for (int j = 0; j<char_exp_length; j++) {
        operator_code =  isOperator(input[j]);
        while (operator_code==-1) {
            token[token_length++] = tolower(input[j]);
            j++;
            if (j>=char_exp_length) {
                token[token_length]='\0';
                num_exp[num_exp_length++]=hashing(token);
                return;
            }
            operator_code=isOperator(input[j]);
        }
        if (token_length!=0) {
            token[token_length]='\0';
            num_exp[num_exp_length++]=hashing(token);
            token_length=0;
        }
        num_exp[num_exp_length++]= operator_code;
    }
    return;
}
int to_postfix(int length){
    int cur=0;
    int stack_head = 0;
    for (int i = 0; i<length; i++) {
        if (num_exp[i]/10 == -1) {
            stack[stack_head++] = num_exp[i]; //push
        }else if(num_exp[i]==CLOSE){
            stack[--stack_head]=0; //delete OPEN
            while(stack_head>0 && stack[stack_head-1]!=OPEN){
                num_exp[cur++] = stack[stack_head-1]; //pop
                stack[--stack_head]=0;
            }
        }else{
            //number
            num_exp[cur++]=num_exp[i];
            while(stack_head>0 && stack[stack_head-1]!=OPEN){
                num_exp[cur++] = stack[stack_head-1]; //pop
                stack[--stack_head]=0;
            }
        }
    }
    while(stack_head>0){
        num_exp[cur++] = stack[stack_head-1]; //pop
        stack[--stack_head]=0;
    }
    return cur;
}

