int calculate(int length, mail m){
    int stack_head = 0, a, b;
    for (int i =0; i<length; i++) {
        if (num_exp[i]>=0) {
            stack[stack_head++] = q[m.id][num_exp[i]]; //exist(num_exp[i], m); //push
        }else if(num_exp[i]==NOT){
            stack[stack_head-1] = !stack[stack_head-1];
        }else{
            a = stack[--stack_head]; //pop
            b = stack[--stack_head]; //pop
            if (num_exp[i]==AND) {
                stack[stack_head++] = a&b; //push
            }else{ //or
                stack[stack_head++] = a|b; //push
            }
        }
    }
    return stack[0];
} 
